// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "remix_tests.sol"; // Remix testing framework
import "./../contracts/SimpleToken.sol";

// Store this test file in a folder named `tests` within Remix.
// Example structure:
// - contracts/
//   - SimpleToken.sol
// - tests/
//   - SimpleTokenTest.sol

contract SimpleTokenTest {
    SimpleToken token;
    address owner = address(this);
    address recipient = address(0x123);

    // Run this setup once before all tests
    function beforeAll() public {
        token = new SimpleToken(1000000);
    }

    // Test initial supply
    function testInitialSupply() public {
        Assert.equal(token.totalSupply(), 1000000 * 10 ** 18, "Initial supply incorrect");
        Assert.equal(token.balanceOf(owner), 1000000 * 10 ** 18, "Owner balance incorrect");
    }

    // Test basic transfer functionality
    function testTransfer() public {
        token.transfer(recipient, 100 * 10 ** 18);
        Assert.equal(token.balanceOf(recipient), 100 * 10 ** 18, "Recipient balance incorrect");
    }

    // Test approve and transferFrom functionality
    function testApproveAndTransferFrom() public {
        token.approve(address(this), 50 * 10 ** 18);
        token.transferFrom(owner, recipient, 50 * 10 ** 18);
        Assert.equal(token.balanceOf(recipient), 150 * 10 ** 18, "Recipient balance incorrect after transferFrom");
    }
}

// To run tests in Remix:
// 1. Open the `tests/SimpleTokenTest.sol` file.
// 2. Click on the Solidity logo in Remix (Testing tab).
// 3. Run tests directly from the Remix UI.

